import React from 'react'
import { View, Text } from 'react-native'

export default function AppbarGlobal() {
    return (
        <View>
            <Image
        style={styles.tinyLogo}
        source={require('@expo/snack-static/react-native-logo.png')}
      />
        </View>
    )
}
